I made some notes on this concept: what an Account means in StarkNet, and how you can originate transaction from it. The idea is that you create your pub/priv keypairs, deploy an account (single owner, or more fancy models like multisig / guardian like what Argent are doing). You prepare the transaction data and sign it, then you pass it to your account contract. The account contract checks the signature according to its particular scheme and the if everything is good it then calls the application. The application can then call `get_caller_address()`, which will now be your account contract! (which no one else can originate transactions from, because they don't control your key(s)).

@martriay mentioned that some aspect of this model has evolved a bit since I wrote it so YMMV. 

