    i : felt, token_id : felt, output : felt*, mod : felt
) -> (res : felt*):
    alloc_locals

    if i == 30:
        return (output)
    end

    local resstr : felt = ''

    let y = 2 * (i - 15) + 1
    let (seed : felt) = id_to_seed_storage.read(token_id)
    let (_, seed_mod_3 : felt) = unsigned_div_rem(seed, 3)
    if seed_mod_3 == 1:
        tempvar z = -y
        tempvar range_check_ptr = range_check_ptr
    else:
        if seed_mod_3 == 2:
            let (y_abs : felt) = abs_value(y)
            tempvar z = y_abs
