func test_keccac_little{range_check_ptr, bitwise_ptr : BitwiseBuiltin*}():
    alloc_locals
    assert 1 = 1

    let (keccak_ptr : felt*) = alloc()
    local keccak_ptr_start : felt* = keccak_ptr
    let (local input : felt*) = alloc()

    assert input[0] = 0  # 8
    assert input[1] = 4779518771825999872  # <=> int.from_bytes(b'\x00\x00\x00\x00\x00CTB', 'little') # 16
    assert input[2] = 3  # 24

    with keccak_ptr:
        let (local res : Uint256) = keccak(inputs=input, n_bytes=24)
    end
    finalize_keccak(keccak_ptr_start=keccak_ptr_start, keccak_ptr_end=keccak_ptr)
    %{
        result_keccak_cairo = ids.res.low + (ids.res.high << 128)
        from eth_hash.auto import keccak
        result_keccak_python = int.from_bytes(keccak(b'\x00\x00\x00\x00\x00\x00\x00\x00\x00\x00\x00\x00\x00CTB\x03\x00\x00\x00\x00\x00\x00\x00'), 'little')
        print(f"Does cairo and python match ? {result_keccak_cairo==result_keccak_python}") # TRUE
    %}

    return ()
end

